// CV.jsx
import React from "react";

function CV({ formData }) {
  const { personalInfo, education, experience, skills } = formData;

  return (
    <div className="cvContainer">
      <div className="PersonalInfo">
        <h2>{personalInfo.fullName}</h2>
        <p>Email: {personalInfo.email}</p>
        <p>Phone: {personalInfo.phone}</p>
      </div>

      {/* <div className="Education">
        <h2>Education</h2>
        {education.map((edu, index) => (
          <div key={index}>
            <p>School: {edu.schoolName}</p>
            <p>Degree: {edu.degreeName}</p>
            <p>Location: {edu.schoolLocation}</p>
            <p>Start Date: {edu.startDate}</p>
            <p>End Date: {edu.endDate}</p>
          </div>
        ))}
      </div> */}

      <div className="Experience">
        <h2>Experience</h2>
        {experience.map((exp, index) => (
          <div key={index}>
            <p>Company: {exp.companyName}</p>
            <p>Position: {exp.positionName}</p>
            <p>Start Date: {exp.startDate}</p>
            <p>End Date: {exp.endDate}</p>
          </div>
        ))}
      </div>

      <div className="Skills">
        <h2>Skills</h2>
        {skills.map((skill, index) => (
          <div key={index}>
            <p>{skill}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default CV;
